import React from "react";
// import "./SearchInput.css"

export default function SearchInput(props) {
  var className = "SearchInput " + props.colPara;
  return (
    <form >
      <div className={className}>
        <input></input>
        <button className="btn">
          <span>搜索</span>
        </button>
      </div>
    </form>
  );
}
